import {ADD_FILE, SET_FORM_DATA_VALUE} from "./actionTypes";

const initialState = {
    exel: false,
    file: null,
    errorType: null,
    uploadText: '',
    formData: {
        departOne: [
            {id: 1, name: 'sku'},
            {id: 2, name: 'name'},
            {id: 3, name: 'points'},
            {id: 4, name: 'measurement'}
        ],
        departTwo: [
            {id: 1, name: 'classifiers'},
            {id: 2, name: 'suppliers'},
            {id: 3, name: 'barcode'},
            {id: 4, name: 'description'}
        ]
    },
    data: {
        sku: '',
        name: '',
        points: '',
        measurement: '',
        classifiers: '',
        suppliers: '',
        barcode: '',
        description: '',
    }
};

export default function importReducer(state = initialState, action) {

    switch (action.type) {

        case SET_FORM_DATA_VALUE:
            return {
                ...state,
                formData: action.formData
            }
        case ADD_FILE:
            return {
                ...state,
                [action.name]: action.value
            }
        default:
            return state;
    }
}
